		 function mixed(Items)
		{
			var newArray= [];
			var orginal=Items.concat();
			while(orginal.length >0)
			{
				var r = Math.floor(Math.random()*(orginal.length));
				  newArray.push(orginal[r]);
				  orginal.splice(r,1);
				
				
			}
			return newArray;
		}
		
		
		
		
